import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

import Test from 'components/Test.js'

const root = ReactDOM.createRoot(document.getElementById('root'));

const nav = (
  <nav>
    <h1>Website</h1>
    <ul>
      <li>Pricing</li>
      <li>About</li>
      <li>Contact</li>
    </ul>
  </nav>
)

root.render(
  <App />
)
